import React from 'react'
import '../../stylesheet/card-list.css'
import Card from '../../components/card/card'
const CardList = (props) => {

 return (
  <div className='card-list'>
     {props.monsters.map((monster) => {
        return (
           <div key={monster.id}>
              <h3>{monster.name}</h3>
           </div>
        )
     })}
  </div>
 )
}
export default CardList
